import MUIDataTable from 'mui-datatables'

const columns = [ 'id', 'user_id', 'app_id', 'total_amount' ]

const options = {
	filterType: 'checkbox'
}

const UserPayApp = ({ data }) => {
	return <MUIDataTable title={'Employee List'} data={data} columns={columns} options={options} />
}

export default UserPayApp
